from collections import defaultdict


def inin(word, dictionary):
    dp = {}
    def is_in(word, dictionary):
        if word in dp:
            return dp[word]
        if len(word) == 0:
            dp[word] = False
            return dp[word]
        for i in range(1,len(word)+1):
            if word[:i] in dictionary:
                if i == len(word):
                    return True
                # (i,word[:i],word[i:]).p()
                if is_in(word[i:], dictionary):
                    dp[word] = True
                    return dp[word]
        dp[word] = False
        return dp[word]
    return is_in(word, dictionary) 




