    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """
        words.sort(key=len)
        n = len(words)
        results = []

        def word_break(word, dictionary):
            m = len(word)  
            n = len(dictionary)
            dp = [False] * m
            for i in range(m):
                for j in range(n):
                    len_w = len(dictionary[j])
                    # (i,j,word[i-len(w)+1:i+1],w,i-len(w)+1).p()
                    if word[i-len_w+1:i+1] == dictionary[j] and (i-len_w+1 == 0 or  dp[i-len_w]):
                            dp[i] = True
                    # dp[i]
            # dp.pp()
            return dp[-1]



        for i in range(n-1,1,-1):
            if word_break(words[i], words[:i]):
                results += words[i],
        # dp.pp()
        return results

    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """
        word_set = set(words)
        ans = []
        for word in words:
            word.p()
            if not word: continue
            stack = [0]
            seen = {0}
            word_l = len(word)
            while stack:
                node = stack.pop()
                if node == word_l:
                    ans.append(word)
                    break
                for j in xrange(1,word_l - node + 1):
                    if (word[node:node+j] in word_set and 
                            node + j not in seen and
                            (node > 0 or node + j != word_l)):
                        stack.append(node + j)
                        seen.add(node + j)
                (node,stack,seen).p()

        return ans


